/*--------------------------------------------------------------------------*/
/*  Scope    :  get information related to PSM from MMP                     */
/*                                                                          */
/*  Return   :  TRUE : returned data are significant, FALSE otherwise       */
/*                                                                          */
/*--------------------------------------------------------------------------*/
/*  Variable Name     |IN |OUT|GLB|  Use                                    */
/*--------------------+---+---+---+-----------------------------------------*/
/*  ReqOrCurr         | x |   |   | Select Current or Requested PSM Infos   */
/*                    |   |   |   | TRUE  : Requested information           */
/*                    |   |   |   | FALSE : Current                         */
/*--------------------+---+---+---+-----------------------------------------*/
/*  pPsmStatus        |   | x |   | Current or Requested PSM status         */
/*--------------------+---+---+---+-----------------------------------------*/
/*  pt3314            |   | x |   | Current or Requested Gprs Ready Timer   */
/*--------------------+---+---+---+-----------------------------------------*/
/*  pt3324            |   | x |   | Current or Requested Active Time Timer  */
/*--------------------+---+---+---+-----------------------------------------*/
/****************************************************************************/
bool mmp_getPsmInfo(bool ReqOrCurr, u8 pPsmStatus, u8 *pt3312, u8 *pt3314, u8 *pt3324)
{
   bool retVal = TRUE;

   if( ( pPsmStatus == NULL ) || ( pt3312 == NULL ) || ( pt3314 == NULL ) || ( pt3324 == NULL ))
   {
      retVal = FALSE;
   }
   else if ( mmp_Global == NULL )
   {
      retVal = FALSE;
   }
   else
   {
      if (TRUE == ReqOrCurr)
      {
         /* Requested PSM information */
         *pPsmStatus = mmp_PsmStatusReq;
         *pt3312     = mmp_T3312PeriodicTimerReq;
         *pt3314     = mmp_ReadyPref;
         *pt3324     = mmp_T3324ActiveTimerReq;
      }
      else
      {
         /* Current PSM information */
         *pPsmStatus = mmp_PsmStatus;
         *pt3312     = mmp_T3312;
         *pt3314     = mmp_Ready;
         *pt3324     = mmp_T3324ActiveTimer;
      }
   }
   return retVal;
}

